    false,nt"url": null,nt"notes": "The core function of the Resource Assessment
    and Conservation Engineering (RACE) Division is to conduct quantitative fishery
    surveys and related ecological and oceanographic research to measure and describe
    the distribution and abundance of commercially important fish and crab stocks in
    the eastern Bering Sea, Aleutian Islands, Gulf of Alaska, and, historically, the
    U.S. West Coast.  As part of these efforts, oceanographic data is collected using
    an instrument attached to the bottom trawl headrope. The data includes: pH, turbidity,
    depth, temperature, salinity and O2.  These data are stored on an AFSC server as
    .txt files.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
